INSERT INTO `adminnotification_inbox` VALUES (1,4,'2018-02-26 02:09:56','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\nOnline documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,1,NULL,NULL,NULL),(2,1,'2018-02-27 12:45:24','Magento Open Source 2.2.3, 2.1.12, and 2.0.18 Enhance Security and Functionality – 2/27/2018','Magento Open Source 2.2.3, 2.1.12, and 2.0.18 include critical security enhancements and feature updates, including support for recent USPS API changes. Review the release notes for more information: http://devdocs.magento.com/guides/v2.2/release-notes/ReleaseNotes2.2.3CE.html, http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.12CE.html, http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.18CE.html  \n','http://devdocs.magento.com/guides/v2.2/release-notes/ReleaseNotes2.2.3CE.html',0,1,NULL,NULL,NULL),(3,3,'2018-04-04 23:29:39','New version 2.8.0 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.8.0\n                             ','https://magefan.com/magento2-blog-extension?version=2.8.0',0,1,NULL,NULL,NULL),(4,1,'2018-04-08 22:04:15','Take Steps to Protect Your Site ','Our goal is to help you deliver the highest level of security to your Magento site. \n\nYou now have access to a security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. It provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. Please be sure to set your site up for security scanning – activation is quick and easy. Access today in your Magento account.\n\nYou should also visit our Security Center which provides alerts around potential issues as well as best practices to help you protect your site against issues, such as brute force attacks. Brute-force password guessing attacks continue to target Magento Open Source (formerly Community Edition) sites worldwide and we have published an  article that explains multiple actions you can take to protect your site from such attacks. In some cases, these attacks have resulted in unauthorized administrative access, so it is important to implement these recommendations.\n\nTo visit the Magento Security Center:\nwww.magento.com/security\n\nTo view steps you can take to protect against issues like brute force, go to:\nwww.magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks','https://magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks',0,1,NULL,NULL,NULL),(5,4,'2018-04-18 09:49:05','We want your opinion! Take our Digital Ad Tools survey.','We\'d like to invite you to take our online survey on digital advertising tools. Your input is valuable to us and will help to inform future products.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/9QQLV67\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/9QQLV67',0,1,NULL,NULL,NULL),(6,4,'2018-05-02 14:07:10','Magento Open Source 2.2.4 Enables Better Shopping Experiences with Integrated Payment, Tax, and Shipping Solutions – 5/2/2018','The latest release of Magento Open Source empowers merchants to create better shopping experiences with performance enhancements and integrations with Amazon Pay, Klarna, and Vertex. Learn how these features can help you reduce cart abandonment and increase average order value, while simplifying your operations at https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce','https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce',0,1,NULL,NULL,NULL),(7,3,'2018-06-02 08:34:30','New version 2.8.1 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.8.1\n                             ','https://magefan.com/magento2-blog-extension?version=2.8.1',0,1,NULL,NULL,NULL),(8,4,'2018-06-12 10:06:10','We want your input! Please take our 10 question payments survey.','We\'d like to invite you to take our brief survey on payments. Your input is valuable to us and will help to inform our future products and services.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/LPV3WVX','https://www.surveymonkey.com/r/LPV3WVX',0,1,NULL,NULL,NULL),(9,1,'2018-06-27 11:45:34','Magento Open Source 2.2.5 delivers important security updates along with performance and functionality enhancements – 6/27/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.5-and-2.1.14-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,1,NULL,NULL,NULL),(10,4,'2018-07-10 13:14:32','We want your opinion! Take our brief Sales and Marketing survey.','We\'d like to invite you to take our short survey on sales channels and digital advertising tools. Your input is valuable to us and will help to inform future products.\n\nThe survey should take no more than 3 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/ChannelSurvey2018\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/ChannelSurvey2018',0,1,NULL,NULL,NULL),(11,4,'2018-07-16 17:00:20','Survey: Help us improve the Admin Panel usability by taking this 5 minute survey.','We\'d like to invite you to take our online survey on Admin Panel Usability. Your input is valuable to us and will help to inform the user experience direction. The survey should take no more than 5 minutes to complete.\n \nTo get started, go to:\nhttps://www.surveymonkey.com/r/SUS-AdHoc-M2','https://www.surveymonkey.com/r/SUS-AdHoc-M2',0,1,NULL,NULL,NULL),(12,4,'2018-08-06 08:42:38','Join our early access program for Magento Payments. Learn more!','Want to get exclusive access to an upcoming new product before it is released to the public?\n\nWant to help influence new payment features Magento is building?\n\nJoin our Early Adopter Program and play a pivotal role in the validation of one of Magento’s newest products.  You will get access to Magento Payments – the payment solution built for Magento by Magento. Magento Payments enables you to instantly accept payments from your customers, offers the right payment options and allows you to manage financial operations with minimal effort. \n \nWe will be granting access to this program to a select number of merchants - we are looking for active participation and regular feedback.\n\nIf you would like to participate and your business is based in the United States, please send an email to: payments@magento.com','www.magento.com',1,1,NULL,NULL,NULL),(13,4,'2018-08-29 08:24:11','Sign-up for Magento Shipping today!','Looking to reduce your shipping costs? Want to expand delivery options you offer your customers? Ship internationally?\n\nYou can with Magento Shipping. Magento Shipping lets you:\n\n•	Easily connect with global shipping carriers from within the Magento Admin \n•	Reduce shipping-related costs\n•	Automate order fulfillment and logistics \n•	Drive cart conversion, customer loyalty, and revenue \n\nIt’s time to take advantage of the new Magento Shipping sign-up process. Just enter your details and you’re ready to go.\n\nThe sooner you select your plan and register, the faster you’ll turn shipping into a profit machine for your business. \n\nSign up today!\n','http://account.magento.com/shipping/onboarding/start?utm_medium=microsite&amp;utm_campaign=1808-PR-EM-EMEA-APAC-MSH-Self-Service-Sign-Up&amp;utm_source=rss',1,1,NULL,NULL,NULL),(14,1,'2018-09-18 16:21:46','Magento Open Source 2.2.6 delivers important security updates along with performance and functionality enhancements – 9/18/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.6-and-2.1.15-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,1,NULL,NULL,NULL),(15,4,'2018-10-30 11:22:42','Help Magento improve our product - take a brief survey ','We want your perspectives on Personalization and Experience Optimization. \n\nYour feedback is 100% confidential.\n\nExperience Optimization refers to A/B/n Testing, Recommendations, and Experience Targeting (dynamic content, emails, promotions, etc.)\n\nThank you!\n\nClick here\nhttps://www.surveymonkey.com/r/M2-Exp-Opt-Oct2018','https://www.surveymonkey.com/r/M2-Exp-Opt-Oct2018',0,1,NULL,NULL,NULL),(16,4,'2018-11-27 13:30:21','Benefit from the Magento Ad Channels Early Access Program','Magento Ad Channels will simplify the set up and administration of Google Merchant Center and Google Ads, while also helping maximize Google Ads ROI to help you accelerate your business growth.\n \nAs an Early Access Program participant, you will gain:\n \n• Exclusive pre-release access to Magento Ad Channels\n• Feedback opportunities to impact features and capabilities\n \nIf you’re a Magento Open Source 2.2.2 or later user, please send an email to sales_channels@magento.com to participate.','https://magento.com/google-smart-shopping-campaigns-in-magento',0,1,NULL,NULL,NULL),(17,1,'2018-11-28 14:03:20','Magento Open Source 2.3.0 delivers Powerful New Merchant and Developer Experience Enhancements – 11/28/2018','The latest release of Magento Commerce includes powerful new tools that enhance both merchant and developer experiences like multi-source inventory management to improve operations and PWA Studio to help create engaging mobile shopping experiences. Magento 2.3 also delivers important security enhancements and performance improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,1,NULL,NULL,NULL),(18,4,'2020-07-05 19:09:16','Deprecation Notice','Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.','',0,0,NULL,NULL,NULL),(19,4,'2020-07-10 00:56:40','Is Your Website Selling as Much as It Can? Take our commerce self-assessment and uncover opportunities to improve conversion rates.','An engaging user experience is essential to converting casual visitors into loyal customers. Find out if your eCommerce environment inspires long-term loyalty with our commerce self-assessment which asks, Is Your Website Selling as Much as It Can? Download now: https://bit.ly/3gt16Qk','https://bit.ly/3gt16Qk',0,0,NULL,NULL,NULL),(20,4,'2020-07-09 17:37:40','All Q2 releases in one place','They help stores work with businesses, save admins` time, and perform smoothly on mobile devices.','https://u.amasty.com/1sa',0,1,1,'2020-07-16 17:37:40','https://amasty.com/static/news/175.svg'),(21,4,'2020-07-16 17:07:00','A new extension to return users to the store','Users look through the catalog, save the products they like in wishlists, and come back to purchase.','https://u.amasty.com/1si',0,1,1,'2020-07-23 01:04:28','https://amasty.com/static/news/176.svg');
