CREATE TABLE `amasty_advanced_review_comments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Comment Id',
  `review_id` bigint(20) unsigned NOT NULL COMMENT 'Review Id',
  `store_id` smallint(5) unsigned NOT NULL COMMENT 'Store Id',
  `status` smallint(5) unsigned NOT NULL COMMENT 'Status',
  `customer_id` int(10) unsigned DEFAULT NULL COMMENT 'Customer Id',
  `message` text COMMENT 'Message',
  `nickname` varchar(255) DEFAULT NULL COMMENT 'Nickname',
  `email` varchar(255) DEFAULT NULL COMMENT 'Email',
  `session_id` varchar(255) DEFAULT NULL COMMENT 'Session Id',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Created At',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Updated At',
  PRIMARY KEY (`id`),
  KEY `AMASTY_ADVANCED_REVIEW_COMMENTS_REVIEW_ID_REVIEW_REVIEW_ID` (`review_id`),
  CONSTRAINT `AMASTY_ADVANCED_REVIEW_COMMENTS_REVIEW_ID_REVIEW_REVIEW_ID` FOREIGN KEY (`review_id`) REFERENCES `review` (`review_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='amasty_advanced_review_comments';
